import React from "react";
import { Box, Typography } from "@mui/material";
import Dialog from '@mui/material/Dialog';
import { styled } from "@mui/material/styles";
import GitHub from "./GitHub.png";

const Img = styled("img")({
	margin: "auto",
	display: "block",
	maxWidth: "100%",
	maxHeight: "100%",
});

const ImgNoMargin = styled("img")({
	display: "block",
	maxWidth: "100%",
	maxHeight: "100%",
});

export default function Projects({calculatedWidth, calculatedHeight, smallerCalculatedWidth, Images}) {
	const [open, setOpen] = React.useState([false, false, false, false, false, false, false, false, false, false, false, false]);

	const handleClickOpen = (index) => {
		const updatedOpen = [false, false, false, false, false, false, false, false, false, false, false, false];
		updatedOpen[index] = true;
		setOpen(updatedOpen);
	};

	const handleClose = () => {
		setOpen([false, false, false, false, false, false, false, false, false, false, false, false]);
	};

	return (
		<>
		<section style={{ display: "flex", paddingLeft: "24px", paddingRight: "24px" }}>
			<Box sx={{
				display: "flex",
				flexDirection: "row",
				alignItems: "center",
				justifyContent: "start",
				width: calculatedWidth,
				height: calculatedHeight
			}}>
				<div
					style={{
						borderLeft: "1.5px solid black",
						height: smallerCalculatedWidth,
						paddingTop: "16px",
						paddingBottom: "16px",
						paddingRight: "16px",
					}}
				/>
				<Box sx={{
					display: "flex",
					flexDirection: "column",
					justifyContent: "center",
					alignItems: "center",
					width: calculatedHeight,
					height: calculatedHeight,
					paddingRight: "16px",
				}}>
					<div
						style={{
							borderTop: "1.5px solid transparent",
							paddingBottom: "16px",
							width: smallerCalculatedWidth
						}}
					/>
					<Dialog
						fullWidth
						maxWidth={"lg"}
						open={open[0]}
						onClose={handleClose}
						PaperProps={{
							sx: {
							  minHeight: "80vh",
							  maxHeight: "80vh",
							  backgroundColor: "#fbf7f0"
							}
						  }}
					>
						<Box sx={{
							display: "flex",
							flexDirection: "column",
							height: "100%"
						}}>
							<Box sx={{
								display: "flex",
								flexDirection: "row",
								justifyContent: "space-between",
								padding: "10px"
							}}>
								<Typography
									sx={{
										fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
										fontWeight: 600,
										color: "#356760",
										px: "4px",
										fontSize: "36px"
									}}
								>
									Bottom-Up Proteomics Data Assessment Tool
								</Typography>
								<ImgNoMargin
									src={GitHub}
									sx={{ height: "50px", width: "50px" }}
								/>
							</Box>
							<Typography sx={{
								fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 500,
								fontSize: "18px",
								px: "14px"
							}}>
								A recreating of Thermo Fisher Scientific's RawMeat using Blazor WebAssembly for device-agnostic tabular and graphical representations of data quality for mass spectrometry raw file scans.
							</Typography>
							<Typography sx={{
								fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 500,
								fontSize: "18px",
								px: "14px",
								py: "5px"
							}}>
								<span style={{ fontWeight: "bold" }}>Duration:</span> Sep 2023 - Present <span style={{ fontWeight: "bold", marginLeft: "16px" }}>Technologies Used:</span> Blazor, WebAssembly, C#, JavaScript
							</Typography>
							<div style={{
								borderBottom: "1.5px solid black",
								marginLeft: "14px",
								marginRight: "14px",
								width: `calc(100% - 28px)`
							}} />
							<Typography
							sx={{
								fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 500,
								color: "#190019",
								fontSize: "18px",
								px: "14px",
								pt: "10px"
							}}
							>
								As part of the Kelleher Research Group at Northwestern University's Proteomics Center of Excellence, I am currently developing a data quality 
								assessment tool that will be open-source and publicly available for research use. <br/><br/>

								Currently, scans containing data for ensemble mass spectrometry are accessable through .raw files that can only be opened using a Windows operating system. 
								Additionally, existing tools like Thermo Fisher Scientific's RawMeat or RawTartare could lack some of the data quality assessment tables or graphs desired for 
								specific use cases or in analyzing individual scans. <br/><br/>

								To solve for these missing features or use case limitations, I have been building a Blazor WebAssembly application that will accept user uploaded .raw files on
								any operating system and output tabular and graphical visualizations of scan information. Existing libraries created by the Kelleher Research Group in C# will be
								used, in addition to SciChart and some JavaScript to create the actual charts. A Model-View-ViewModel (MVVM) pattern will be implemented and testing will be done to
								guarantee results compared to well-documented scans of proteoforms and Thermo Fisher Scientific's RawMeat and RawTartare products.
							</Typography>
						</Box>
					</Dialog>
					<Box
						sx={{
							height: smallerCalculatedWidth,
							width: smallerCalculatedWidth,
							position: 'relative',
							cursor: "pointer",
							transition: "box-shadow 0.3s",
							'&:hover': {
								boxShadow: "0 0 32px #356760", 
							}
						}}
						onClick={() => handleClickOpen(0)}
					>
						<Img
							alt="proteins2"
							src={Images[1]}
							sx={{ height: smallerCalculatedWidth, width: smallerCalculatedWidth }}
						/>
						<div
							style={{
							zIndex: 1,
							background: "transparent",
							position: "absolute",
							top: "0",
							left: "0",
							display: "flex",
							justifyContent: "flex-start", 
							alignItems: "center",
							textAlign: "center",
							width: "90%",
							}}
						>
							<Typography
							sx={{
								fontFamily:
								'"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 600,
								color: "white",
								fontSize: 16, 
								marginRight: "8px",
								marginLeft: "8px",
								marginTop: "8px"
							}}
							>
							In Progress
							</Typography>
						</div>
						<div
							style={{
							zIndex: 1,
							background: "transparent",
							position: "absolute",
							top: "50%",
							left: "50%",
							transform: "translate(-50%, -50%)",
							display: "flex",
							justifyContent: "center",
							alignItems: "center",
							textAlign: "center",
							width: "90%",
							}}
						>
							<Typography
							sx={{
								fontFamily:
								'"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 600,
								color: "white",
								fontSize: 24,
								lineHeight: 1.25
							}}
							>
							Bottom-Up Proteomics Data Assessment Tool
							</Typography>
						</div>
					</Box>
					<div
						style={{
							borderBottom: "1.5px solid black",
							paddingTop: "16px",
							width: smallerCalculatedWidth
						}}
					/>
				</Box>
				<div
					style={{
						borderLeft: "1.5px solid black",
						height: smallerCalculatedWidth,
						paddingTop: "16px",
						paddingBottom: "16px",
						paddingRight: "16px",
					}}
				/>
				<Box sx={{
					display: "flex",
					flexDirection: "column",
					justifyContent: "center",
					alignItems: "center",
					width: calculatedHeight,
					height: calculatedHeight,
					paddingRight: "16px",
				}}>
					<div
						style={{
							borderTop: "1.5px solid transparent",
							paddingBottom: "16px",
							width: smallerCalculatedWidth
						}}
					/>
					<Box
						sx={{
							height: smallerCalculatedWidth,
							width: smallerCalculatedWidth,
							position: 'relative',
							cursor: "pointer",
							transition: "box-shadow 0.3s",
							'&:hover': {
								boxShadow: "0 0 32px #356760", 
							}
						}}
					>
						<Img
							alt="proteins3"
							src={Images[0]}
							sx={{ height: smallerCalculatedWidth, width: smallerCalculatedWidth }}
						/>
						<div
							style={{
							zIndex: 1,
							background: "transparent",
							position: "absolute",
							top: "0",
							left: "0",
							display: "flex",
							justifyContent: "flex-start", 
							alignItems: "center",
							textAlign: "center",
							width: "90%",
							}}
						>
							<Typography
							sx={{
								fontFamily:
								'"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 600,
								color: "white",
								fontSize: 16, 
								marginRight: "8px",
								marginLeft: "8px",
								marginTop: "8px"
							}}
							>
							In Progress
							</Typography>
						</div>
						<div
							style={{
							zIndex: 1,
							background: "transparent",
							position: "absolute",
							top: "50%",
							left: "50%",
							transform: "translate(-50%, -50%)",
							display: "flex",
							justifyContent: "center",
							alignItems: "center",
							textAlign: "center",
							width: "90%",
							}}
						>
							<Typography
							sx={{
								fontFamily:
								'"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
								fontWeight: 600,
								color: "white",
								fontSize: 24,
								lineHeight: 1.25
							}}
							>
							CAFA-5 Protein Function Prediction
							</Typography>
						</div>
					</Box>
					<div
						style={{
							borderBottom: "1.5px solid black",
							paddingTop: "16px",
							width: smallerCalculatedWidth
						}}
					/>
				</Box>
				<div
					style={{
						borderLeft: "1.5px solid black",
						height: smallerCalculatedWidth,
						paddingTop: "16px",
						paddingBottom: "16px",
						paddingRight: "16px",
					}}
				/>
				<Box sx={{
					display: "flex",
					flexDirection: "column",
					justifyContent: "center",
					alignItems: "center",
					width: calculatedHeight,
					height: calculatedHeight,
					paddingRight: "16px",
				}}>
					<div
						style={{
							borderTop: "1.5px solid transparent",
							paddingBottom: "16px",
							width: smallerCalculatedWidth
						}}
					/>
					<Box
						sx={{
							height: smallerCalculatedWidth,
							width: smallerCalculatedWidth,
							position: 'relative',
							cursor: "pointer",
							transition: "box-shadow 0.3s",
							'&:hover': {
								boxShadow: "0 0 32px #356760", 
							}
						}}
					>
						<Img
							alt="battery"
							src={Images[4]}
							sx={{ height: smallerCalculatedWidth, width: smallerCalculatedWidth }}
						/>
						<div
							style={{
							zIndex: 1,
							background: "transparent",
							position: "absolute",
							top: "0",
							left: "0",
							display: "flex",
							justifyContent: "flex-start", 
							alignItems: "center",
							textAlign: "center",
							width: "90%",
							}}
						>
